import React, { Component } from 'react';
import { useEvents } from '../../context/EventContext';
import { useNavigate } from 'react-router-dom';
import './EventCreate.css';

// Wrapper function to use hooks with class component
const EventCreateWrapper = () => {
    const { addEvent } = useEvents();
    const navigate = useNavigate();
    return <EventCreate addEvent={addEvent} navigate={navigate} />;
};

class EventCreate extends Component {
    constructor(props) {
        super(props);
        this.state = {
            eventName: '',
            eventDate: '',
            eventLocation: '',
            eventDescription: '',
            capacity: '',
            errorMessage: ''
        };
    }

    handleInputChange = (e) => {
        const { name, value } = e.target;
        this.setState({ [name]: value, errorMessage: '' });
    }

    validateForm = () => {
        const { eventName, eventDate, eventLocation, eventDescription, capacity } = this.state;
        if (!eventName || !eventDate || !eventLocation || !eventDescription || !capacity) {
            this.setState({ errorMessage: 'All fields are required' });
            return false;
        }
        if (isNaN(capacity) || parseInt(capacity) <= 0) {
            this.setState({ errorMessage: 'Capacity must be a positive number' });
            return false;
        }
        return true;
    }

    handleSubmit = (e) => {
        e.preventDefault();
        if (!this.validateForm()) return;

        const newEvent = {
            name: this.state.eventName,
            date: this.state.eventDate,
            location: this.state.eventLocation,
            description: this.state.eventDescription,
            capacity: parseInt(this.state.capacity),
            registeredParticipants: 0
        };

        this.props.addEvent(newEvent);
        this.setState({
            eventName: '',
            eventDate: '',
            eventLocation: '',
            eventDescription: '',
            capacity: '',
            errorMessage: ''
        });

        // Show success message and redirect
        alert('Event created successfully!');
        this.props.navigate('/events');
    }

    render() {
        return (
            <div className="event-create-container">
                <h2>Create New Event</h2>
                {this.state.errorMessage && (
                    <div className="error-message">{this.state.errorMessage}</div>
                )}
                <form onSubmit={this.handleSubmit} className="event-form">
                    <div className="form-group">
                        <label>Event Name:</label>
                        <input
                            type="text"
                            name="eventName"
                            value={this.state.eventName}
                            onChange={this.handleInputChange}
                            placeholder="Enter event name"
                        />
                    </div>
                    <div className="form-group">
                        <label>Date:</label>
                        <input
                            type="date"
                            name="eventDate"
                            value={this.state.eventDate}
                            onChange={this.handleInputChange}
                            min={new Date().toISOString().split('T')[0]}
                        />
                    </div>
                    <div className="form-group">
                        <label>Location:</label>
                        <input
                            type="text"
                            name="eventLocation"
                            value={this.state.eventLocation}
                            onChange={this.handleInputChange}
                            placeholder="Enter event location"
                        />
                    </div>
                    <div className="form-group">
                        <label>Capacity:</label>
                        <input
                            type="number"
                            name="capacity"
                            value={this.state.capacity}
                            onChange={this.handleInputChange}
                            placeholder="Enter maximum capacity"
                            min="1"
                        />
                    </div>
                    <div className="form-group">
                        <label>Description:</label>
                        <textarea
                            name="eventDescription"
                            value={this.state.eventDescription}
                            onChange={this.handleInputChange}
                            placeholder="Enter event description"
                            rows="4"
                        />
                    </div>
                    <button type="submit" className="submit-btn">Create Event</button>
                </form>
            </div>
        );
    }
}

export default EventCreateWrapper;
